import React from "react";
import Layout from "../../components/Layout/Layout";
import AdminMenu from "../../components/Layout/AdminMenu";

const Users = () => {
  return (
    <Layout>
      <div className="row">
        <div className="col mb-3">
          <AdminMenu />
        </div>
        <div className="col mb-9">
          <h1>All Users</h1>
        </div>
      </div>
    </Layout>
  );
};

export default Users;
